	function go(){
		var sex = $("#sex").val();
		var age = $("#age").val();
        var skin = $("#skin").val();
		
		var result = bodies.find(function(body){
			return body.Sex == sex && body.Age == age && body.Skin == skin; 
		})
		console.log(result);
		
		$("#person").html(result.bodie);
		changePreset();
	}
	
	
//funzioni che aspettano cambiamenti dell'utente sulle select
//"quando viene cambiato il valore di #malePresets, avvia la funzione changePreset"
	$('#malePresetsSelector').change(changePreset);


//funzione che fa cose quando c'è un cambiamento nella select dei presets
//"nascondi tutti gli elementi con classe .presets, e mostra solo quello che ha per id il valore di #malePresetsSelector"
	function changePreset(){
		$('.presets').hide();
		$('#' + $('#malePresetsSelector').val()).show();
	}

